import React, { useState, useMemo } from "react";
import ReactDOM from "react-dom";
import {
  Form,
  FormGroup,
  Label,
  Input,
  Modal,
  ModalHeader,
  ModalBody,
  ModalFooter,
  Col,
  Row,
  Alert,
} from "reactstrap";
import MuiPhoneNumber from "material-ui-phone-number";
import Profile from "../../utils/Images/pro.jpg";
import TextareaAutosize from "@mui/material/TextareaAutosize";
import CountrySelect from "../CountrySelect";
// import Profile from "../utils/Images/pro.jpg";
import Avatar from "@mui/material/Avatar";
import Stack from "@mui/material/Stack";
import TimezoneSelect from "react-timezone-select";
import ResponsiveDrawer from "../../Dashboard/Sidebar/ResponsiveDrawer";
import Navbar from "../../Dashboard/Navbar/Navbar";
import { CountryRegionData } from "react-country-region-selector";
import TextField from "@material-ui/core/TextField";
import SendIcon from "@mui/icons-material/Send";
import { makeStyles } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";
import yellow from "@material-ui/core/colors/yellow";
import Box from "@material-ui/core/Box";
import InputLabel from "@mui/material/InputLabel";
// import Select from "@mui/material/Select";
import MenuItem from "@mui/material/MenuItem";
import { styled } from "@mui/material/styles";
import Typography from "@material-ui/core/Typography";
import Customize from "../../../core/Customize";
import CardContent from "@material-ui/core/CardContent";
import CardActions from "@material-ui/core/CardActions";
import Button from "@material-ui/core/Button";
import Card from "@material-ui/core/Card";
// import CountrySelect from "./CountrySelect";
import Link from "@mui/material/Link";
import { Editor } from "react-draft-wysiwyg";
import "react-draft-wysiwyg/dist/react-draft-wysiwyg.css";
import CompanyText from "../CompanyText";
import { TxtField } from "../../reusecomponents/TextFields/TextField";
import { useLocation } from "react-router-dom";
import countryList from "react-select-country-list";
import Select from "react-select";
import IndustryClassificationSelect from "industry-classification-select";
import CompanyLogo from "../../utils/Images/companylogo.svg";

// import CompanyInfo from "../Forms/company/CompanyInfo";
import { useHistory } from "react-router-dom";
import "../../Forms/style.css";
import Star from "../../utils/Images/star.png";

const useStyles = makeStyles((theme) => ({
  root: {
    // marginTop: "50px",
    marginTop: "4%",
    marginLeft: "7%",
    width: "70%",
    height: "40%",
  },
  paper: {
    width: "100%",
    height: "80%",
    display: "block",
    alignItems: "center",
    elevation: "6",
    borderRadius: "30px !important",
    marginTop: "-3.5%",
    padding: "0.5% 2% 2% 2%",
    //marginLeft: '20%',
    marginRight: "2%",
    zIndex: "1",
  },
  papercontent: {
    marginTop: "0",
    display: "block",
    position: "relative",
  },
  headline_1: {
    fontSize: "1.5rem",
    fontSize: "2vw !important",
    color: "#211572",
    fontWeight: "bold",
    marginTop: "2%",
  },
  headline_2: {
    color: "#211572",
    fontWeight: "bold !important",
    fontSize: "1rem !important",
    marginTop: "1rem !important",
    // marginBottom: '2rem !important',
    fontFamily: "Nunito Sans",
  },
  text_1: {
    color: "#130d3c",
    fontSize: "1vw !important",
    fontWeight: "semibold",
    fontFamily: "Nunito Sans",
    marginTop: "1rem",
    marginBottom: "0.5rem",
    textDecoration: "none !important",
  },
  text_2: {
    color: "#130d3c",
    fontSize: "1vw !important",
    fontWeight: "none",
    fontFamily: "Nunito Sans",
    marginBottom: "0.5rem",
  },
  activeTab: {
    color: "#ff771b !important",
    fontSize: "1vw !important",
    fontWeight: "semibold !important",
    textDecoration: "none !important",
    borderBottom: "2px solid #ff771b",
    paddingBottom: "0.5%",
    marginLeft: "-2.5% !important",
  },
  //   activeTab:{
  //     fontSize: '1.1 rem',
  //     color: '#ff771b',
  //     borderBottom: '2px solid #ff771b',
  //     fontWeight: 'bold !important',
  // },

  tab: {
    color: "#130d3c",
    fontSize: "1vw !important",
    fontWeight: "semibold",
    fontFamily: "Nunito Sans",
    marginTop: "1rem",
    marginBottom: "0.5rem",
    textDecoration: "none !important",
  },

  field: {
    marginBottom: "2rem !important",
    fontSize: "12px",
    variant: "outlined",
    "&.Mui-focused fieldset": {
      borderColor: "yellow",
    },
    "& label.Mui-focused": {
      color: "white",
    },
  },
  star: {
    width: "8px",
    height: "8px",
  },
  save_btn: {
    background: "orange",
    color: "white",
    // marginBottom: '1rem !important',
    width: "7vw",
    height: "5vh",
    marginRight: "1.5rem",
    textTransform: "none !important",
  },
  cancel_btn: {
    background: "white",
    color: "#211572",
    fontWeight: "semibold",
    width: "7vw",
    height: "5vh",
    textTransform: "none !important",
  },
  add_img_btn: {
    fontColor: "white !important",
    background: "#ff771b",
    opacity: "0.2",
    fontSize: "0.6rem !important",
    fontWeight: "semibold",
    marginTop: "2rem",
    textTransform: "none !important",
  },
  avatar: {
    width: "8%",
    height: "8%",
    marginLeft: "30%",
  },
  bottom_paper: {
    borderRadius: "30px",
    padding: "24px",
    marginLeft: "20%",
    marginTop: "5%",
    background: "#F8F8FD",
    width: "maxcontent !important",
    alignItems: "center",
  },
  carousel_img: {
    width: "100%",
    height: "140px",
  },
}));

export default function Variants(props) {
  const location = useLocation();

  const [country, setCountry] = React.useState("India");
  const options = useMemo(() => countryList().getData(), []);

  const countryHandler = (country) => {
    setCountry(country);
  };

  // console.log(location.pathname)
  let passedPath = 1;

  if (location.pathname == "/companyvideo") {
    passedPath = 2;
  } else if (location.pathname == "/companylink") {
    passedPath = 3;
  } else if (location.pathname == "/companyphoto") {
    passedPath = 4;
  }

  const classes = useStyles();
  const history = useHistory();
  const [firstname, setFirstName] = useState("");
  // const [editorState, setEditorState] = useState("");
  const [lastname, setLastName] = useState("");
  const preventDefault = (event) => event.preventDefault();

  const companyprofilecompleted = (e) => {
    history.push("/companyprofilecompleted");
    // dispatch(addItem());
    e.preventDefault();
  };

  const Input = styled("input")({
    display: "none",
  });
  return (
    <>
      <div>
        <Navbar />
      </div>
      <div className="personal_details_parent">
        <ResponsiveDrawer />
        {/* <div className={`${classes.root} Personal_Information `}> */}
        <div className={classes.root}>
          <Paper className={classes.paper} elevation={6}>
            <Box p={1}>
              <Typography className={classes.headline_2}>
                Company Profile
              </Typography>
              <Box
                sx={{
                  marginLeft: "25px",
                  marginTop: "12px",
                  display: "flex",
                  flexWrap: "wrap",
                  justifyContent: "left",
                  typography: "body1",
                  "& > :not(style) + :not(style)": {
                    ml: 2,
                  },
                }}
                onClick={preventDefault}
              >
                <Link
                  className={passedPath == 1 ? classes.activeTab : classes.tab}
                  onClick={() => {
                    history.push("companyinfo");
                  }}
                  cursor="pointer"
                >
                  Company Info
                </Link>
                <br />
                <Link
                  onClick={() => {
                    history.push("companyvideo");
                  }}
                  className={passedPath == 2 ? classes.activeTab : classes.tab}
                  style={{ marginLeft: "30px" }}
                >
                  Videos
                </Link>

                <br />
                <Link
                  onClick={() => {
                    history.push("companylink");
                  }}
                  className={passedPath == 3 ? classes.activeTab : classes.tab}
                  style={{ marginLeft: "30px" }}
                >
                  Links
                </Link>
                <br />
                <Link
                  onClick={() => {
                    history.push("companyphoto");
                  }}
                  className={passedPath == 4 ? classes.activeTab : classes.tab}
                  style={{ marginLeft: "30px" }}
                >
                  Photos
                </Link>
                <br />
              </Box>
              <hr style={{ marginTop: 0 }}></hr>
              <div>
                <Typography className={classes.headline_2}>
                  Company Information
                </Typography>

                <Grid
                  container
                  direction="row"
                  style={{
                    width: "100%",
                  }}
                >
                  {/* first panel for the basic info */}
                  <Grid xs={8} style={{ marginTop: "-20px" }}>
                    {/* inner grid starts here */}
                    <Grid container direction="columns" spacing={12}>
                      {/* company name wrapper */}
                      <Grid xs={6}>
                        <div>
                          {/* Company name */}
                          <Typography className={classes.text_2}>
                            Company name
                            <sup>
                              <img
                                src={Star}
                                alt="star"
                                className={classes.star}
                              />
                            </sup>
                          </Typography>

                          <div style={{ marginRight: "12px" }}>
                            <TxtField placeholder="Enter company name"></TxtField>
                          </div>
                        </div>
                      </Grid>

                      {/* company website wrapper */}
                      <Grid item={true} xs={6}>
                        <div>
                          {/* Company website */}
                          <Typography className={classes.text_2}>
                            Company website
                            <sup>
                              <img
                                src={Star}
                                alt="star"
                                className={classes.star}
                              />
                            </sup>
                          </Typography>

                          <div style={{ marginRight: "12px" }}>
                            <TxtField placeholder="Enter company website"></TxtField>
                          </div>
                        </div>
                      </Grid>
                    </Grid>
                    {/* inner grid ends here */}

                    <Grid container direction="columns" spacing={12}>
                      {/* company contact wrapper */}
                      <Grid xs={6}>
                        <div>
                          {/* Company contact */}
                          <Typography className={classes.text_2}>
                            Contact Number
                            <sup>
                              <img
                                src={Star}
                                alt="star"
                                className={classes.star}
                              />
                            </sup>
                          </Typography>

                          <div style={{ marginRight: "12px" }}>
                            <MuiPhoneNumber
                              name="phone"
                              size="small"
                              style={{
                                width: "100%",
                                marginBottom: "20px",
                              }}
                              placeholder="Contact Number"
                              variant="outlined"
                              data-cy="user-phone"
                              defaultCountry={"in"}
                            />
                          </div>
                        </div>
                      </Grid>

                      {/* company gst wrapper */}
                      <Grid item={true} xs={6}>
                        <div>
                          {/* Company gst */}
                          <Typography className={classes.text_2}>
                            GST Number
                            <sup>
                              <img
                                src={Star}
                                alt="star"
                                className={classes.star}
                              />
                            </sup>
                          </Typography>

                          <div style={{ marginRight: "12px" }}>
                            <TxtField placeholder="Enter company GST"></TxtField>
                          </div>
                        </div>
                      </Grid>
                    </Grid>

                    <Grid container direction="columns" spacing={12}>
                      {/* company address 1 wrapper */}
                      <Grid xs={6}>
                        <div>
                          {/* Company contact */}
                          <Typography className={classes.text_2}>
                            Address Line 1
                            <sup>
                              <img
                                src={Star}
                                alt="star"
                                className={classes.star}
                              />
                            </sup>
                          </Typography>

                          <div style={{ marginRight: "12px" }}>
                            <TxtField placeholder="Area/Street/Landmark"></TxtField>
                          </div>
                        </div>
                      </Grid>

                      {/* company gst wrapper */}
                      <Grid item={true} xs={6}>
                        <div>
                          {/* Company gst */}
                          <Typography className={classes.text_2}>
                            Address Line 2
                            <sup>
                              <img
                                src={Star}
                                alt="star"
                                className={classes.star}
                              />
                            </sup>
                          </Typography>

                          <div style={{ marginRight: "12px" }}>
                            <TxtField placeholder="City/Town/Location"></TxtField>
                          </div>
                        </div>
                      </Grid>
                    </Grid>

                    {/* country and zip code */}
                    <Grid container direction="columns" spacing={12}>
                      <Grid xs={6}>
                        {/* Country */}
                        <div>
                          <Typography className={classes.text_2}>
                            Country
                            <sup>
                              <img
                                src={Star}
                                alt="star"
                                className={classes.star}
                              />
                            </sup>
                          </Typography>
                        </div>

                        <div style={{ marginRight: "12px" }}>
                          <Select
                            options={options}
                            country={country}
                            onChange={countryHandler}
                            defaultCountry="India"
                            className={classes.field}
                          />
                        </div>
                      </Grid>

                      <Grid xs={6}>
                        <div>
                          {/* Zip code */}
                          <Typography className={classes.text_2}>
                            Zip code
                            <sup>
                              <img
                                src={Star}
                                alt="star"
                                className={classes.star}
                              />
                            </sup>
                          </Typography>
                          <div style={{ marginRight: "12px" }}>
                            <TxtField placeholder=""></TxtField>
                          </div>
                        </div>
                      </Grid>
                    </Grid>

                    {/* Industry */}
                    <Grid container direction="columns" spacing={12}>
                      <Grid xs={6}>
                        <Typography className={classes.text_2}>
                          Industry
                          <sup>
                            <img
                              src={Star}
                              alt="star"
                              className={classes.star}
                            />
                          </sup>
                        </Typography>

                        <div style={{ marginRight: "12px" }}>
                          <Select
                            options={options}
                            country={country}
                            sx={{ width: "100%" }}
                            onChange={countryHandler}
                            className={classes.field}
                          />
                        </div>
                      </Grid>
                    </Grid>

                    {/* about company (text) */}
                    <Grid container direction="columns" spacing={12}>
                      <Grid xs={12}>
                        <Typography className={classes.text_2}>
                          About company
                          <sup>
                            <img
                              src={Star}
                              alt="star"
                              className={classes.star}
                            />
                          </sup>
                        </Typography>

                        <div style={{ marginRight: "12px" }}>
                          <CompanyText />
                        </div>
                      </Grid>
                    </Grid>

                    {/* about company (attachment) */}
                    <Grid container direction="columns" spacing={12}>
                      <Grid xs={12}>
                        {/* attachment wrapper */}
                        <div style={{ marginTop: "12px" }}>
                          <Typography className={classes.text_2}>
                            Attach File (About Company)
                          </Typography>
                          <div
                            style={{
                              border: "1px dashed lightGrey",
                              padding: "5%",
                              display: "flex",
                              flexDirection: "column",
                              alignItems: "center",
                              marginRight: "12px",
                            }}
                          >
                            <Typography
                              style={{
                                fontSize: "0.7rem",
                                color: "lightgray",
                                marginTop: "1.2rem",
                              }}
                            >
                              Drop file here format should be PDF
                            </Typography>
                            <Typography
                              style={{
                                fontSize: "0.8rem",
                                color: "#130d3c",
                                fontWeight: "semibold",
                                marginTop: "1rem",
                              }}
                            >
                              Or
                            </Typography>
                            <Button
                              style={{
                                marginTop: "1rem",
                                border: "1px solid blue",
                                fontSize: "0.8rem",
                                fontWeight: "none",
                                textTransform: "none !important",
                              }}
                              variant="outlined"
                              size="small"
                            >
                              Upload file
                            </Button>
                          </div>
                        </div>
                      </Grid>
                    </Grid>
                  </Grid>

                  {/* second panel for the logo */}
                  <Grid
                    xs={4}
                    style={{
                      marginTop: "-20px",
                      alignItems: "center",
                      display: "flex",
                      flexDirection: "column",
                      paddingTop: "10%",
                    }}
                  >
                    {/* Company avatar */}
                    <div
                      style={{
                        background: `transparent url(${CompanyLogo}) 0% 0% no-repeat padding-box`,
                        width: "170px",
                        height: "170px",
                        backgroundColor: "#EBF2FF",
                        borderRadius: "50%",
                        backgroundPosition: "center",
                      }}
                    ></div>
                    {/* Add company logo button */}
                    <Button className={classes.add_img_btn} variant="outlined">
                      Add company image
                    </Button>
                  </Grid>
                </Grid>

                <div>
                  <div style={{ display: "flex", marginTop: "1rem" }}>
                    <Button
                      className={classes.save_btn}
                      onClick={companyprofilecompleted}
                    >
                      Save
                    </Button>
                    <Button variant="outlined" className={classes.cancel_btn}>
                      Cancel
                    </Button>
                  </div>
                </div>
              </div>
            </Box>
          </Paper>
        </div>
      </div>
    </>
  );
}
